import { createApp } from 'vue'
import App from './App.vue'

createApp(App).mount('#app')

import axios from 'axios';

axios.get('http://localhost:3000/api/cursos')
  .then(response => {
    console.log(response.data);
  })
  .catch(error => {
    console.error(error);
  });
